import './App.min.css';
import { BrowserRouter, Routes, } from 'react-router-dom';
import ContactsView from './views/ContactsView';
import HomeView from './views/HomeView';

function App() {
  return (
    <BrowserRouter>
      <Routes></Routes>
      <HomeView />
      <ContactsView />
    </BrowserRouter>
  );
}

export default App;
